<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":215619,"title":"Titanic analysis using R","forkParent":null,"currentRunId":1022156,"mostRecentRunId":1022156,"url":"/caliphcheng/titanic-analysis-using-r","tags":[],"commentCount":0,"upvoteCount":0,"viewCount":329,"forkCount":2,"bestPublicScore":0.78947,"author":{"id":829163,"displayName":"Carl","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"caliphcheng","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/default-thumb.png","profileUrl":"/caliphcheng","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":0,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2017-03-20T12:07:08.03Z","selfLink":"/kernels/215619","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":null,"writeGroupId":null,"slug":"titanic-analysis-using-r"},"kernelBlob":{"id":5052991,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# This R script will run on our backend. You can write arbitrary code here!\n\n# Many standard libraries are already installed, such as randomForest\nlibrary(\u0027stringr\u0027)\nlibrary(\u0027rpart\u0027)\nlibrary(\u0027ggplot2\u0027)\nlibrary(\u0027dplyr\u0027)\nlibrary(\u0027randomForest\u0027)\nlibrary(\u0027caret\u0027)\nlibrary(\u0027purrr\u0027)\nlibrary(\u0027mice\u0027)\nlibrary(\u0027tidyr\u0027)\n\n# The train and test data is stored in the ../input directory\ntrain_raw \u003c- read.csv(\u0022../input/train.csv\u0022, stringsAsFactors = FALSE)\ntest_raw  \u003c- read.csv(\u0022../input/test.csv\u0022, stringsAsFactors = FALSE)\ntest_raw$Survived \u003c- NA\n\n# Stack the training and testing dataset to handle missing values\nall \u003c- rbind(train_raw, test_raw)\nall[all == \u0027\u0027] \u003c- NA\n\n# Set factor variables\nall$Pclass \u003c- as.factor(all$Pclass)\n\nall$Sex \u003c- as.factor(all$Sex)\n\n\n# Compute the family size\nFamily_size \u003c- all$SibSp + all$Parch + 1\ntable(Family_size)\nall$Family[Family_size==1] \u003c- \u0027Single\u0027\nall$Family[Family_size\u003e1 \u0026 Family_size\u003c=4] \u003c- \u0027Small\u0027\nall$Family[Family_size\u003e=5] \u003c- \u0027Big\u0027\n\n\n\n# Create a title variable\nall$Title \u003c- gsub(pattern = \u0027.*,\\\\s|\\\\..*\u0027,\u0027\u0027,all$Name)\nnames(table(all$Title)[table(all$Title) \u003c 20])\n#Male Rare title: \nall$Title[all$Title %in% \n               c(\u0027Capt\u0027, \u0027Don\u0027, \u0027Major\u0027, \u0027Sir\u0027, \u0027Col\u0027, \u0027Jonkheer\u0027, \u0027Rev\u0027, \u0027Dr\u0027)] \u003c- \u0027Mr\u0027\n\n#Female Rare title:\nall$Title[all$Title %in% c(\u0027Mlle\u0027, \u0027Mme\u0027, \u0027Ms\u0027)] \u003c- \u0027Miss\u0027\nall$Title[all$Title %in% c(\u0027the Countess\u0027, \u0027Lady\u0027, \u0027Dona\u0027)] \u003c- \u0027Mrs\u0027\n\n\n\n# Make character variables factors\nfac_var \u003c- c(\u0027PassengerId\u0027, \u0027Name\u0027, \u0027Ticket\u0027, \u0027Cabin\u0027, \u0027Embarked\u0027, \u0027Title\u0027, \u0027Family\u0027,\n             \u0027Survived\u0027)\nall[,fac_var] \u003c- all[,fac_var] %\u003e%\n     map_df(as.factor)\n\n\n\n# Find which variables have missing value\napply(all, 2, function(x) {sum(is.na(x))}) # Age, Fare, Cabin, Embarked\n\n\n#impute using mice()\nall_rf \u003c- all[,-c(1,2,4,7,8,9,11)] %\u003e%\n     mice(method = \u0027rf\u0027) %\u003e%\n     mice::complete()\n\nall_cart \u003c- all[,-c(1,2,4,7,8,9,11)] %\u003e%\n     mice(method = \u0027cart\u0027) %\u003e%\n     mice::complete()\n\n# visulization of age\nage_orig \u003c- all$Age\nage_rf \u003c- all_rf$Age\nage_cart \u003c- all_cart$Age\nage1 \u003c- as.data.frame(cbind(age_orig,age_cart,age_rf))\nnames(age1) \u003c- c(\u0027Original\u0027, \u0027CART\u0027, \u0027RF\u0027)\nage \u003c- gather(age1, key = origin, value = age, Original, CART, RF)\nggplot(age,aes(x = age, y = ..density.., fill = origin)) + \n     stat_bin(alpha = 0.5, position = position_dodge(1))\n# From the histogram, we find random forest has a slightly better result than \n# cart, so we use the RF imputation\n\nall[,c(\u0027Age\u0027, \u0027Fare\u0027, \u0027Embarked\u0027)] \u003c- all_rf[,c(\u0027Age\u0027, \u0027Fare\u0027, \u0027Embarked\u0027)]\n\n\n\n# Split the data back to training and testing dataset\ntrain \u003c- all[1:nrow(train_raw),]\ntest \u003c- all[-(1:nrow(train_raw)),]\n\nset.seed(16)\n\n# Model 1.Random Forest\ncontrol_rf \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                           savePredictions = \u0027final\u0027 )\nmodel_rf \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                  train, method = \u0027rf\u0027, trControl = control_rf)\n\n\n# train_rf_pred \u003c- predict.train(model_rf,train[,-2])\ntrain_rf_pred \u003c- model_rf$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\n\n# Assess the training result\nclass_assess \u003c- function(x) {\n     # train$Pred \u003c- x\n     pred_table \u003c- table(x$obs,x$pred)\n     tp \u003c- pred_table[1,1]\n     fp \u003c- pred_table[1,2]\n     fn \u003c- pred_table[2,1]\n     tn \u003c- pred_table[2,2]\n     Accuracy \u003c- sum(diag(pred_table)) / sum(pred_table)\n     Precision \u003c- tp / (tp + fp)\n     Recall \u003c- tp / (tp + fn)\n     F1_Score \u003c- 2 * Precision * Recall / (Precision + Recall)\n     return(data.frame(Accuracy = Accuracy, Precision = Precision,\n                       Recall = Recall, F1_Score = F1_Score))\n}\n\nRF \u003c- class_assess(train_rf_pred)\n\n\n\n\n\n# Model 2.Support Vector Machine\ncontrol_svm \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                            savePredictions = \u0027final\u0027 )\nmodel_svm \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                   train, method = \u0027svmLinear\u0027, trControl = control_svm)\n\ntrain_svm_pred \u003c- model_svm$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nSVM \u003c- class_assess(train_svm_pred)\n\n\n\n\n# Model 3.K Nearest Neighbor\ncontrol_knn \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                            savePredictions = \u0027final\u0027 )\nmodel_knn \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                   train, method = \u0027kknn\u0027, trControl = control_knn)\n\ntrain_knn_pred \u003c- model_knn$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nKNN \u003c- class_assess(train_knn_pred)\n\n\n# Model 4.Neural Network\ncontrol_nnet \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                             savePredictions = \u0027final\u0027 )\nmodel_nnet \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                    train, method = \u0027nnet\u0027, trControl = control_nnet)\n\ntrain_nnet_pred \u003c- model_nnet$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nNNET \u003c- class_assess(train_nnet_pred)\n\ncomparison \u003c- rbind(RF = RF,SVM = SVM,KNN = KNN,NNET = NNET)\ncomparison #Neural Network has the best result\n\n\n# Making prediction based on the best model\ntest_pred \u003c- predict.train(model_nnet,test)\ntitanic_prediction \u003c- data.frame(PassengerId = test$PassengerId, \n                                 Survived = test_pred)\nwrite.csv(titanic_prediction, file = \u0022Titanic_prediction.csv\u0022,row.names=FALSE)","dateCreated":"2017-03-20T12:07:06.793Z"},"kernelRun":{"id":1022156,"kernelId":215619,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"Titanic analysis using R","dateCreated":"2017-03-20T12:07:06.793Z","dateEvaluated":"2017-03-20T12:07:08.03Z","workerContainerPort":null,"workerUptimeSeconds":1521760,"workerIPAddress":"10.3.0.7       ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":5052991,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# This R script will run on our backend. You can write arbitrary code here!\n\n# Many standard libraries are already installed, such as randomForest\nlibrary(\u0027stringr\u0027)\nlibrary(\u0027rpart\u0027)\nlibrary(\u0027ggplot2\u0027)\nlibrary(\u0027dplyr\u0027)\nlibrary(\u0027randomForest\u0027)\nlibrary(\u0027caret\u0027)\nlibrary(\u0027purrr\u0027)\nlibrary(\u0027mice\u0027)\nlibrary(\u0027tidyr\u0027)\n\n# The train and test data is stored in the ../input directory\ntrain_raw \u003c- read.csv(\u0022../input/train.csv\u0022, stringsAsFactors = FALSE)\ntest_raw  \u003c- read.csv(\u0022../input/test.csv\u0022, stringsAsFactors = FALSE)\ntest_raw$Survived \u003c- NA\n\n# Stack the training and testing dataset to handle missing values\nall \u003c- rbind(train_raw, test_raw)\nall[all == \u0027\u0027] \u003c- NA\n\n# Set factor variables\nall$Pclass \u003c- as.factor(all$Pclass)\n\nall$Sex \u003c- as.factor(all$Sex)\n\n\n# Compute the family size\nFamily_size \u003c- all$SibSp + all$Parch + 1\ntable(Family_size)\nall$Family[Family_size==1] \u003c- \u0027Single\u0027\nall$Family[Family_size\u003e1 \u0026 Family_size\u003c=4] \u003c- \u0027Small\u0027\nall$Family[Family_size\u003e=5] \u003c- \u0027Big\u0027\n\n\n\n# Create a title variable\nall$Title \u003c- gsub(pattern = \u0027.*,\\\\s|\\\\..*\u0027,\u0027\u0027,all$Name)\nnames(table(all$Title)[table(all$Title) \u003c 20])\n#Male Rare title: \nall$Title[all$Title %in% \n               c(\u0027Capt\u0027, \u0027Don\u0027, \u0027Major\u0027, \u0027Sir\u0027, \u0027Col\u0027, \u0027Jonkheer\u0027, \u0027Rev\u0027, \u0027Dr\u0027)] \u003c- \u0027Mr\u0027\n\n#Female Rare title:\nall$Title[all$Title %in% c(\u0027Mlle\u0027, \u0027Mme\u0027, \u0027Ms\u0027)] \u003c- \u0027Miss\u0027\nall$Title[all$Title %in% c(\u0027the Countess\u0027, \u0027Lady\u0027, \u0027Dona\u0027)] \u003c- \u0027Mrs\u0027\n\n\n\n# Make character variables factors\nfac_var \u003c- c(\u0027PassengerId\u0027, \u0027Name\u0027, \u0027Ticket\u0027, \u0027Cabin\u0027, \u0027Embarked\u0027, \u0027Title\u0027, \u0027Family\u0027,\n             \u0027Survived\u0027)\nall[,fac_var] \u003c- all[,fac_var] %\u003e%\n     map_df(as.factor)\n\n\n\n# Find which variables have missing value\napply(all, 2, function(x) {sum(is.na(x))}) # Age, Fare, Cabin, Embarked\n\n\n#impute using mice()\nall_rf \u003c- all[,-c(1,2,4,7,8,9,11)] %\u003e%\n     mice(method = \u0027rf\u0027) %\u003e%\n     mice::complete()\n\nall_cart \u003c- all[,-c(1,2,4,7,8,9,11)] %\u003e%\n     mice(method = \u0027cart\u0027) %\u003e%\n     mice::complete()\n\n# visulization of age\nage_orig \u003c- all$Age\nage_rf \u003c- all_rf$Age\nage_cart \u003c- all_cart$Age\nage1 \u003c- as.data.frame(cbind(age_orig,age_cart,age_rf))\nnames(age1) \u003c- c(\u0027Original\u0027, \u0027CART\u0027, \u0027RF\u0027)\nage \u003c- gather(age1, key = origin, value = age, Original, CART, RF)\nggplot(age,aes(x = age, y = ..density.., fill = origin)) + \n     stat_bin(alpha = 0.5, position = position_dodge(1))\n# From the histogram, we find random forest has a slightly better result than \n# cart, so we use the RF imputation\n\nall[,c(\u0027Age\u0027, \u0027Fare\u0027, \u0027Embarked\u0027)] \u003c- all_rf[,c(\u0027Age\u0027, \u0027Fare\u0027, \u0027Embarked\u0027)]\n\n\n\n# Split the data back to training and testing dataset\ntrain \u003c- all[1:nrow(train_raw),]\ntest \u003c- all[-(1:nrow(train_raw)),]\n\nset.seed(16)\n\n# Model 1.Random Forest\ncontrol_rf \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                           savePredictions = \u0027final\u0027 )\nmodel_rf \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                  train, method = \u0027rf\u0027, trControl = control_rf)\n\n\n# train_rf_pred \u003c- predict.train(model_rf,train[,-2])\ntrain_rf_pred \u003c- model_rf$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\n\n# Assess the training result\nclass_assess \u003c- function(x) {\n     # train$Pred \u003c- x\n     pred_table \u003c- table(x$obs,x$pred)\n     tp \u003c- pred_table[1,1]\n     fp \u003c- pred_table[1,2]\n     fn \u003c- pred_table[2,1]\n     tn \u003c- pred_table[2,2]\n     Accuracy \u003c- sum(diag(pred_table)) / sum(pred_table)\n     Precision \u003c- tp / (tp + fp)\n     Recall \u003c- tp / (tp + fn)\n     F1_Score \u003c- 2 * Precision * Recall / (Precision + Recall)\n     return(data.frame(Accuracy = Accuracy, Precision = Precision,\n                       Recall = Recall, F1_Score = F1_Score))\n}\n\nRF \u003c- class_assess(train_rf_pred)\n\n\n\n\n\n# Model 2.Support Vector Machine\ncontrol_svm \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                            savePredictions = \u0027final\u0027 )\nmodel_svm \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                   train, method = \u0027svmLinear\u0027, trControl = control_svm)\n\ntrain_svm_pred \u003c- model_svm$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nSVM \u003c- class_assess(train_svm_pred)\n\n\n\n\n# Model 3.K Nearest Neighbor\ncontrol_knn \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                            savePredictions = \u0027final\u0027 )\nmodel_knn \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                   train, method = \u0027kknn\u0027, trControl = control_knn)\n\ntrain_knn_pred \u003c- model_knn$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nKNN \u003c- class_assess(train_knn_pred)\n\n\n# Model 4.Neural Network\ncontrol_nnet \u003c- trainControl(method = \u0027cv\u0027, number = 10, verboseIter = TRUE, \n                             savePredictions = \u0027final\u0027 )\nmodel_nnet \u003c- train(Survived ~ Pclass + Sex + Age + Family + Embarked + Title,\n                    train, method = \u0027nnet\u0027, trControl = control_nnet)\n\ntrain_nnet_pred \u003c- model_nnet$pred[,c(\u0027pred\u0027, \u0027obs\u0027)]\nNNET \u003c- class_assess(train_nnet_pred)\n\ncomparison \u003c- rbind(RF = RF,SVM = SVM,KNN = KNN,NNET = NNET)\ncomparison #Neural Network has the best result\n\n\n# Making prediction based on the best model\ntest_pred \u003c- predict.train(model_nnet,test)\ntitanic_prediction \u003c- data.frame(PassengerId = test$PassengerId, \n                                 Survived = test_pred)\nwrite.csv(titanic_prediction, file = \u0022Titanic_prediction.csv\u0022,row.names=FALSE)","dateCreated":"2017-03-20T12:07:06.793Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e472556\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:a236e47ea687b7714dba889be0a21997c74dbf72cebaf1deca68fc5e0b45a975\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e52.6673799799755\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/time t","description":null},{"order":9,"originalType":"","type":"numeric","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Fare","description":null},{"order":10,"originalType":"","type":"string","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Cabin","description":null},{"order":11,"originalType":"","type":"string","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Embarked","description":"The port in which a passenger has embarked. C - Cherbourg, S - Southampton, Q = Queenstown"}],"totalRows":null,"type":"genericTable","collapsed":true,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1022156,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-03-20T12:07:06.793Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":0,"linesInsertedFromPrevious":166,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:a236e47ea687b7714dba889be0a21997c74dbf72cebaf1deca68fc5e0b45a975","dockerImageName":"kaggle/rstats","exitCode":0,"failureM
